import { useState } from "react";
import { useParams } from "react-router-dom";


function SingleColor(){

    const [] = useState();
    const params = useParams();
    const {paletteId} = params;
    return(
        <div>
            {paletteId}
            hello
        </div>
    )
}

export default SingleColor;
